<template>    <div class="con_icon_five" v-on:click="openLink">        <span class="icon" v-bind:class='icon2'></span>        <span class="title">{{itemProp.cat_name}}</span>    </div></template><script>    export default {        name:'con_icon_five',        data(){            let self = this;            return {                item:self.itemProp,                icon2:{}            }        },        created(){            let self = this;            self.iconClass();            //console.log(self.item);        },        methods:{            openLink: function () {                let self = this;//                self.ad_LXclick();                window.location.href = self.item.url;               // window.open(self.item.url);            },            iconClass: function () {                let self = this;                let iconObj = {                    iconA:false,                    iconB:false,                    iconC:false,                    iconD:false,                    iconE:false,                    iconF:false,                    iconG:false,                    iconH:false,                };                switch (self.item.cat_id){                    case 10: iconObj.iconA = true; break;                    case 50: iconObj.iconB = true; break;                    case 55: iconObj.iconC = true; break;                    case 30: iconObj.iconD = true; break;                    case 45: iconObj.iconE = true; break;                    case 70: iconObj.iconF = true; break;                    case 90: iconObj.iconG = true; break;                    case 75: iconObj.iconH = true; break;                }                self.icon2 = iconObj;            }        },        props:{            itemProp:{                type:Object            }        },        computed:{},        components:{}    }</script>